const lengthOfLongestSubstring = function(s) {
  let longestStr = '';
  if (s.length > 0) {
    longestStr = s[0];
  }
  let subStr = '';
  for (let i = 0; i < s.length; i++) {
    subStr = s[i];
    for (let j = i + 1; j < s.length; j++) {
      subStr += s[j];
      if (noRepeat(subStr)) {
        if (subStr.length > longestStr.length) {
          longestStr = subStr;
        }
      }
    }
  }
  return longestStr.length;
};

const noRepeat = function(s) {
  let letterInven = {};
  for (let i = 0; i < s.length; i++) {
    if (letterInven[s[i]]) {
      return false;
    }
    letterInven[s[i]] = 1;
  }
  return true;
};

